int
_mfd_wmanIfBsServiceClassTable_undo_values(netsnmp_mib_handler *handler,
                                           netsnmp_handler_registration
                                           *reginfo,
                                           netsnmp_agent_request_info
                                           *agtreq_info,
                                           netsnmp_request_info *requests)
{
    int             rc;
    wmanIfBsServiceClassTable_rowreq_ctx *rowreq_ctx =
        netsnmp_container_table_row_extract(requests);
    netsnmp_table_request_info *tri;

    DEBUGMSGTL(("internal:wmanIfBsServiceClassTable:_mfd_wmanIfBsServiceClassTable_undo_values", "called\n"));

    netsnmp_assert(NULL != rowreq_ctx);

    rc = wmanIfBsServiceClassTable_undo(rowreq_ctx);
    if (MFD_SUCCESS != rc) {
        /*
         * nothing we can do about it but log it
         */
        DEBUGMSGTL(("wmanIfBsServiceClassTable:mfd", "error %d from "
                    "wmanIfBsServiceClassTable_undo\n", rc));
    }

    for (; requests; requests = requests->next) {
        /*
         * set column data
         */
        tri = netsnmp_extract_table_info(requests);
        if (NULL == tri)
            continue;

        rc = _wmanIfBsServiceClassTable_undo_column(rowreq_ctx,
                                                    requests->requestvb,
                                                    tri->colnum);
        if (MFD_SUCCESS != rc) {
            /*
             * nothing we can do about it but log it
             */
            DEBUGMSGTL(("wmanIfBsServiceClassTable:mfd", "error %d from "
                        "wmanIfBsServiceClassTable_undo_column\n", rc));
        }
    }                           /* for results */

    return SNMP_ERR_NOERROR;
}                               /* _mfd_wmanIfBsServiceClassTable_undo_values */

/*----------------------------------------------------------------------
 *
 * SET: irreversible commit
 *
 *---------------------------------------------------------------------*/
/**
 * @internal
 * commit irreversible actions
 */
int
_mfd_wmanIfBsServiceClassTable_irreversible_commit(netsnmp_mib_handler
                                                   *handler,
                                                   netsnmp_handler_registration
                                                   *reginfo,
                                                   netsnmp_agent_request_info
                                                   *agtreq_info,
                                                   netsnmp_request_info
                                                   *requests)
{
    wmanIfBsServiceClassTable_rowreq_ctx *rowreq_ctx =
        netsnmp_container_table_row_extract(requests);

    DEBUGMSGTL(("internal:wmanIfBsServiceClassTable:_mfd_wmanIfBsServiceClassTable_irreversible:commit", "called\n"));

    netsnmp_assert(NULL != rowreq_ctx);

    /*
     * check for and handle row creation/deletion
     * and update column exist flags...
     */
    if (rowreq_ctx->rowreq_flags & MFD_ROW_DELETED) {
        if (!(rowreq_ctx->rowreq_flags & MFD_ROW_CREATED))
            CONTAINER_REMOVE(wmanIfBsServiceClassTable_if_ctx.container,
                             rowreq_ctx);
    } else {
        if (rowreq_ctx->column_set_flags) {
            rowreq_ctx->column_set_flags = 0;
        }
        if (rowreq_ctx->rowreq_flags & MFD_ROW_CREATED) {
            rowreq_ctx->rowreq_flags &= ~MFD_ROW_CREATED;
            CONTAINER_INSERT(wmanIfBsServiceClassTable_if_ctx.container,
                             rowreq_ctx);
        }
    }

    return SNMP_ERR_NOERROR;
}                               /* _mfd_wmanIfBsServiceClassTable_irreversible_commit */

